import React, { Component } from "react";
import Navigation from "../components/Navigation";


class SearchResult extends Component {
    render() {
        return (
            <div>
                <Navigation {...this.props} />
                <h3>Search Result</h3>
            </div>
        )
    }
}

export default SearchResult;
